function(el, x) {
    el.on("plotly_hover", function(eventdata) {
        var group_id_index = el._fullData.findIndex(
            obj => obj.name == eventdata.points[0].data.name);
        if (group_id_index != -1) {
            Plotly.Fx.hover(
                el,
                Array(el._fullData[group_id_index].x.length)
                    .fill()
                    .map((_, i) =>
                        ({
                            curveNumber: group_id_index,
                            pointNumber: i
                        })
                    )
                );
        }
    });
}

